function generatePdfBakim(obj:{
  birlikAdi,
  sistemAdi,
  bolgeKodu,
  kontrolNo,
  belgeTarihi,
  tarih,
  bakimBaslangicZamani,
  bakimBitisZamani,
  periyod,
  malzemeler,
  dokuman,
  aciklama,
  personel,
  yonetici
}){
  var doc = new jsPDF('l');
  var PTSans = getFont();
  var base64=  getBaseBakimFormu();
  doc.addFileToVFS("PTSans.ttf", PTSans);
  doc.addFont('PTSans.ttf', 'PTSans', 'normal');
  doc.addFont('PTSans.ttf', 'PTSans', 'bold');
  var ttt2:any = JSON.stringify(doc.getFontList());
  ttt2 = ttt2.replace('{','');
  ttt2 = ttt2.replace('}','');
  ttt2 = ttt2.split('],');
  doc.setFont('PTSans');
  doc.addImage(base64,'JPEG',0,0,297,210);
  doc.setFontSize(12);
  doc.setFontType("normal");

  doc.text(obj.birlikAdi, 34, 35);
  doc.text(obj.sistemAdi, 122, 35);
  doc.text(obj.kontrolNo, 232, 35);

  doc.text(obj.belgeTarihi +" "+ obj.bakimBaslangicZamani, 60, 55);
  doc.text(obj.belgeTarihi +" "+ obj.bakimBitisZamani, 160, 55);
  doc.text(obj.periyod, 250, 55);

  doc.text(obj.dokuman , 10, 105);
  doc.text(obj.aciklama, 10, 139);

  doc.setFontSize(12);
  doc.text(obj.personel ,90,182)
  doc.setFontSize(8);
  doc.text(obj.personel ,90,182)

  doc.setFontSize(12);
  doc.text(obj.yonetici, 151, 182);
  doc.setFontSize(8);
  doc.text(obj.yonetici, 151, 182);

  doc.save("belgeTarihi" + "-" + "belgeNo");



}
